import {GetError} from "./ErrorsReducer";
import {MessageActionTypes} from "./MessageReducer";

export const GET_COUNTRIES = "GET_COUNTRIES"
export const GET_PROFILES = "GET-PROFILES"
export const GET_DOCUMENTS = "GET-DOCUMENTS"
export const GET_CATEGORY = "GET-CATEGORY"
export const GET_SEARCHED_PROFILES = "GET_SEARCHED_PROFILES"

interface GetCountries {
    type: typeof GET_COUNTRIES,
    payload: any
}

export type SingleProfile = {
        id: number,
        companyProfilePicture: string,
        companyName: string,
        companyDescription: string,
        country: string,
        companyLogo: string,
        sections: string,
        owner: number
    }

export type SingleDocument = {
        id: number,
        Title: any,
        Thumbnail: any,
        Download: any,
        owner: number
    }   

interface GetProfiles {
    type: typeof GET_PROFILES,
    payload: Array<{
        id: number,
        companyProfilePicture: string,
        companyName: string,
        companyDescription: string,
        country: string,
        companyLogo: string,
        sections: string,
        owner: number
    }>
}

interface GetDocuments {
    type: typeof GET_DOCUMENTS,
    payload: Array<{
        id: number,
        Title: any,
        Thumbnail: any,
        Download: any,
        owner: number
    }>
}

interface GetCategory {
    type: typeof GET_CATEGORY,
    payload: Array<{
        id: number,
        Name: string
    }>
}

interface GetSearchedProfiles {
    type: typeof GET_SEARCHED_PROFILES,
    payload: Array<{
        id: number,
        companyProfilePicture: string,
        companyName: string,
        companyDescription: string,
        country: string,
        companyLogo: string,
        sections: string,
        owner: number
}>
}

export type ProfileActionTypes = GetCountries | GetError | GetProfiles | GetDocuments | GetCategory | GetSearchedProfiles  | MessageActionTypes
